import React, { Component } from "react";
export default class Testimonials extends Component {
  render() {
    return (
      <section id="testimonials">
        <div className="text-container">
          <div className="row">
            <div className="two columns header-col">
              <h1>
                <span>Client Testimonials</span>
              </h1>
            </div>
            <div className="ten columns flex-container">
              <div className="flexslider">
                <ul className="slides">
                  <li>
                    <blockquote>
                      <p>
                        Your work is going to fill a large part of your life,
                        and the only way to be truly satisfied is to do what you
                        believe is great work. And the only way to do great work
                        is to love what you do. If you haven't found it yet,
                        keep looking. Don't settle. As with all matters of the
                        heart, you'll know when you find it.
                      </p>
                      <cite>Steve Jobs</cite>
                    </blockquote>
                  </li>{" "}
                  {/* slide ends */}
                  <li>
                    <blockquote>
                      <p>
                        Coding is so widespread a concept that prevails the entire universe.
                        From the genes of the smallest beings to the mathematical embroidery of 
                        the gigantic celestial bodies. Even the slightest typo in the fabric of configuration thereof,
                        would mean a nasty error leading to non-existence. I believe coding is a natural mimicry of creation. 
                      </p>
                      <cite>Bilal Sarimeseli</cite>
                    </blockquote>
                  </li>{" "}
                  {/* slide ends */}
                </ul>
              </div>{" "}
              {/* div.flexslider ends */}
            </div>{" "}
            {/* div.flex-container ends */}
          </div>{" "}
          {/* row ends */}
        </div>{" "}
        {/* text-container ends */}
      </section>
    );
  }
}
